import React from "react";
import "./App.css";
import Mastercard from "./mastercard.png";
import Sbi from "./sbi.png";
function Card() {
  return (
    <section className="card-section">
      <div className="front-face">
        <div className="front-face-heading">
          <h2 style={{ paddingLeft: 20, paddinTop: 20 }}>gold</h2>
          <img src={Sbi} id="sbi-logo" width={100} />
          <img src={Mastercard} id="mastercard-logo" width={100} />
        </div>
      </div>

      <div className="back-face"></div>
    </section>
  );
}

export default Card;
